const DisplayHome = () => {
      const { courseStore } = useMobxStores();
     return (
       <div>
            home page {courseStore.likesCount}
<br/>
            <Button primary onClick={() =>  courseStore.setCount() }>Add</Button>
       </div>
     )
}
 
  class Index extends Component {
//     static async getInitialProps({ mobxStore, query }) {
